import React, { useState, useEffect } from 'react';

const MonitoringTable = () => {
  // Load initial data from localStorage or default
  const initialData = JSON.parse(localStorage.getItem('monitoringData')) || {
    attendance: { present: '', registered: '' },
    lectureDelivery: { quality: '', effectiveness: '' },
    studentEngagement: { participation: '', questions: '', interaction: '' },
    classroomEnv: { venue: '', technology: '', atmosphere: '' }
  };

  const [data, setData] = useState(initialData);

  // Save to localStorage whenever data changes
  useEffect(() => {
    localStorage.setItem('monitoringData', JSON.stringify(data));
  }, [data]);

  const handleChange = (section, field, value) => {
    setData(prev => ({
      ...prev,
      [section]: {
        ...prev[section],
        [field]: value
      }
    }));
  };

  return (
    <div className="container mt-4">
      <h4 style={{ textDecoration: 'underline' }}>Monitoring Details</h4>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th colSpan="2">Attendance</th>
            <th colSpan="3">Lecture Delivery</th>
            <th colSpan="3">Student Engagement</th>
            <th colSpan="3">Classroom Environment</th>
          </tr>
          <tr>
            {/* Attendance */}
            <th>Present</th>
            <th>Registered</th>
            {/* Lecture Delivery */}
            <th>Quality</th>
            <th>Effectiveness</th>
            {/* Student Engagement */}
            <th>Participation</th>
            <th>Questions</th>
            <th>Interaction</th>
            {/* Classroom Environment */}
            <th>Venue</th>
            <th>Technology</th>
            <th>Atmosphere</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            {/* Attendance */}
            <td>
              <input
                type="number"
                className="form-control"
                value={data.attendance.present}
                onChange={(e) => handleChange('attendance', 'present', e.target.value)}
              />
            </td>
            <td>
              <input
                type="number"
                className="form-control"
                value={data.attendance.registered}
                onChange={(e) => handleChange('attendance', 'registered', e.target.value)}
              />
            </td>
            {/* Lecture Delivery */}
            <td>
              <input
                type="text"
                className="form-control"
                value={data.lectureDelivery.quality}
                onChange={(e) => handleChange('lectureDelivery', 'quality', e.target.value)}
              />
            </td>
            <td>
              <input
                type="text"
                className="form-control"
                value={data.lectureDelivery.effectiveness}
                onChange={(e) => handleChange('lectureDelivery', 'effectiveness', e.target.value)}
              />
            </td>
            {/* Student Engagement */}
            <td>
              <input
                type="text"
                className="form-control"
                value={data.studentEngagement.participation}
                onChange={(e) => handleChange('studentEngagement', 'participation', e.target.value)}
              />
            </td>
            <td>
              <input
                type="text"
                className="form-control"
                value={data.studentEngagement.questions}
                onChange={(e) => handleChange('studentEngagement', 'questions', e.target.value)}
              />
            </td>
            <td>
              <input
                type="text"
                className="form-control"
                value={data.studentEngagement.interaction}
                onChange={(e) => handleChange('studentEngagement', 'interaction', e.target.value)}
              />
            </td>
            {/* Classroom Environment */}
            <td>
              <input
                type="text"
                className="form-control"
                value={data.classroomEnv.venue}
                onChange={(e) => handleChange('classroomEnv', 'venue', e.target.value)}
              />
            </td>
            <td>
              <input
                type="text"
                className="form-control"
                value={data.classroomEnv.technology}
                onChange={(e) => handleChange('classroomEnv', 'technology', e.target.value)}
              />
            </td>
            <td>
              <input
                type="text"
                className="form-control"
                value={data.classroomEnv.atmosphere}
                onChange={(e) => handleChange('classroomEnv', 'atmosphere', e.target.value)}
              />
            </td>
          </tr>
        </tbody>
      </table>
      {/* Optional: add a button to explicitly save to localStorage */}
      {/* <button className="btn btn-primary" onClick={() => localStorage.setItem('monitoringData', JSON.stringify(data))}>Save Monitoring Data</button> */}
    </div>
  );
};

export default MonitoringTable;
